import React from "react";

export const HeroBanner: React.FC = () => {
  const logo = "https://cdn1.iconfinder.com/data/icons/cute-corgi-dog-emoticon/595/CUTE_CORGI_DOG_EMOTICON-08-512.png";

  return (
    <div className="hero-banner hero-banner--pink-yellow">
      <div className="hero-banner__logo">
        <img className="hero-banner__image" src={logo} alt="icon logo" />
      </div>
      <h1 className="hero-banner__headline">Welcome</h1>
      <p className="hero-banner__description">
        This is a demo application that demonstrates report pulling protected by <strong>Auth0</strong>.
      </p>
      <a
        id="code-sample-link"
        target="_blank"
        rel="noopener noreferrer"
        href="https://developer.auth0.com/resources/code-samples/spa/react/basic-authentication/typescript-react-router-6"
        className="button button--secondary"
      >
        Check out the React code sample â†’
      </a>
    </div>
  );
};
